Gv("common/dequeue.effekt",'module dequeue\n\n\n// An implementation of a functional dequeue, using Okasaki\'s\n// bankers dequeue implementation.\n//\n// Translation from the Haskell implementation:\n//   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Bool \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n\n\ndef show[A](d: Dequeue[A]) { showA: A \x3d\x3e String }: String \x3d {\n  val Dequeue(front, frontSize, rear, rearSize) \x3d d;\n  "Dequeue(" ++ show(front){showA} ++ ", " ++ show(frontSize) ++ ", " ++\n      show(rear){showA} ++ ", " ++ show(rearSize) ++ ")"\n}\ndef show(l: Dequeue[Int]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Double]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Bool]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[String]): String \x3d show(l) { e \x3d\x3e e }\n\ndef println(l: Dequeue[Int]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Double]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Bool]): Unit \x3d println(show(l))\ndef println(l: Dequeue[String]): Unit \x3d println(show(l))\n');
Gv("common/args.effekt",'module args\n\nextern io def commandLineArgs(): List[String] \x3d\n  js { js::commandLineArgs() }\n  chez { chez::commandLineArgs() }\n  ml { ml::commandLineArgs() }\n  llvm { llvm::commandLineArgs() }\n\nnamespace js {\n  extern type Args // \x3d Array[String]\n\n  extern io def nativeArgs(): Args \x3d js "process.argv.slice(1)"\n\n  extern io def argCount(args: Args): Int \x3d js "${args}.length"\n\n  extern io def argument(args: Args, i: Int): String \x3d js "${args}[${i}]"\n\n  def commandLineArgs(): List[String] \x3d {\n    def toList(args: Args, start: Int, acc: List[String]): List[String] \x3d\n      if (start \x3c 1) { acc }\n      else args.toList(start - 1, Cons(args.argument(start), acc))\n\n    val args \x3d nativeArgs()\n    args.toList(args.argCount - 1, Nil())\n  }\n}\n\nnamespace chez {\n  extern type Args // \x3d CSList[String]\n\n  extern io def nativeArgs(): Args \x3d\n    chez "(cdr (command-line))"\n\n  extern pure def isEmpty(l: Args): Bool \x3d\n    chez "(null? ${l})"\n\n  extern pure def head(l: Args): String \x3d\n    chez "(car ${l})"\n\n  extern pure def tail(l: Args): Args \x3d\n    chez "(cdr ${l})"\n\n  def toList(l: Args): List[String] \x3d\n    if (l.isEmpty) Nil() else Cons(l.head, l.tail.toList)\n\n  def commandLineArgs(): List[String] \x3d nativeArgs().toList\n}\n\nnamespace ml {\n\n  // MLList[String]\n  // we inline these from mllist to not have a dependency\n  extern type Args\n\n  extern io def nativeArgs(): Args \x3d\n    ml "CommandLine.arguments ()"\n\n  extern pure def isEmpty(args: Args): Bool \x3d\n    ml "null ${args}"\n\n  extern io def first(a: Args): String \x3d\n    ml "hd ${a}"\n\n  extern io def rest(a: Args): Args \x3d\n    ml "tl ${a}"\n\n\n  def commandLineArgs(): List[String] \x3d {\n    def toList(args: Args): List[String] \x3d\n      if (args.isEmpty) Nil() else Cons(args.first, args.rest.toList)\n    nativeArgs().toList\n  }\n}\n\nnamespace llvm {\n  extern io def argCount(): Int \x3d\n    llvm !!!MULTILINEMARKER!!!\n      %c \x3d call %Int @c_get_argc()\n      ret %Int %c\n    !!!MULTILINEMARKER!!!\n\n  extern io def argument(i: Int): String \x3d\n    llvm !!!MULTILINEMARKER!!!\n      %s \x3d call %Pos @c_get_arg(%Int ${i})\n      ret %Pos %s\n    !!!MULTILINEMARKER!!!\n\n  def commandLineArgs(): List[String] \x3d {\n    def toList(start: Int, acc: List[String]): List[String] \x3d\n      if (start \x3c 1) { acc }\n      else toList(start - 1, Cons(argument(start), acc))\n\n    toList(argCount() - 1, Nil())\n  }\n}\n');
Gv("common/exception.effekt",'module exception\n\nimport effekt\n\n// Exceptions\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\ninterface Exception[E] {\n  def raise(exception: E, msg: String): Nothing\n}\n\ndef raise[A, E](exception: E, msg: String): A / Exception[E] \x3d\n  do raise(exception, msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect a non-empty\n * container (e.g. option or list).\n */\nrecord MissingValue()\n\ndef missingValue(): Nothing / Exception[MissingValue] \x3d\n  do raise(MissingValue(), "Missing value.")\n\n/**\n * Used as a type for `Exception` in functions where an index can be out of bounds.\n */\nrecord OutOfBounds()\n\n/**\n * Unexpected runtime exceptions that can be caught.\n */\nrecord RuntimeError()\n\ndef raise[A](msg: String): A / Exception[RuntimeError] \x3d\n  do raise(RuntimeError(), msg) match {}\n\n/**\n * Used as a type for `Exception` in functions which expect the input\n * to be formatted in a specific way.\n */\nrecord WrongFormat()\n\ndef wrongFormat(): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), "Wrong format.")\n\ndef wrongFormat(msg: String): Nothing / Exception[WrongFormat] \x3d\n  do raise(WrongFormat(), msg)\n\n\n/**\n * A fatal runtime error that cannot be caught\n */\nextern io def panic[R](msg: String): R \x3d\n  js "(function() { throw ${msg} })()"\n  chez "(raise ${msg})"\n  ml "raise Fail ${msg}"\n  llvm !!!MULTILINEMARKER!!!\n    call void @c_io_println_String(%Pos ${msg})\n    call void @exit(i32 1)\n    ret %Pos zeroinitializer ; Unit\n  !!!MULTILINEMARKER!!!\n\n\n// Exception Handlers\n// \x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\x3d\n\n\n/**\n * Converts exceptions of (static) type E to an uncatchable panic that aborts the program\n */\ndef panicOn[E, T] { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d panic(msg) }\n\n/**\n * Reports exceptions of (static) type E to the console\n */\ndef report[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d println(msg) }\n\n/**\n * Ignores exceptions of (static) type E\n */\ndef ignore[E] { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d () }\n\n/**\n * Use the default value to handle the exception of type E\n */\ndef default[E, T] { default: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  try { prog() } with Exception[E] { def raise(exception: E, msg: String) \x3d default() }\n\n/**\n * Runs the finalizer and rethrows E\n */\ndef finalize[E, T] { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  try { val res \x3d prog(); finalizer(); res } with Exception[E] {\n    def raise(exception: E, msg: String) \x3d { finalizer(); do raise(exception, msg) }\n  }\n\n/**\n * A proxy value to enable partial type applications, such as:\n *\n * ```\n * with on[MissingValue].ignore; ...\n * ```\n */\nrecord on[E]()\n\ndef ignore[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  ignore[E] {prog}\n\ndef default[E, T](proxy: on[E]) { d: \x3d\x3e T } { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  default[E, T] {d} {prog}\n\ndef panic[E, T](proxy: on[E]) { prog: \x3d\x3e T / Exception[E] }: T \x3d\n  panicOn[E, T] {prog}\n\ndef report[E](proxy: on[E]) { prog: \x3d\x3e Unit / Exception[E] }: Unit \x3d\n  report[E] {prog}\n\ndef finalize[E, T](proxy: on[E]) { finalizer: \x3d\x3e Unit } { prog: \x3d\x3e T / Exception[E] }: T / Exception[E] \x3d\n  finalize[E, T] {finalizer} {prog}');
Gv("common/option.effekt",'module option\n\nimport effekt\nimport exception\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Bool \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Bool \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\ndef value[A](self: Option[A]): A / Exception[MissingValue] \x3d self match {\n  case None() \x3d\x3e do raise(MissingValue(), "Trying to get the value of an empty option")\n  case Some(v) \x3d\x3e v\n}\n\ndef option[A] { p: \x3d\x3e A / Exception[MissingValue] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[MissingValue] { def raise(_, _) \x3d None() }\n\ndef option[A, E](proxy: on[E]) { p: \x3d\x3e A / Exception[E] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[E] { def raise(_, _) \x3d None() }\n\n// Interop with FFI\n// ---------------\n// These functions should only be used by libraries that interface with FFI\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\n\n// Show Instances\n// --------------\n\ndef show[A](o: Option[A]) { showA: A \x3d\x3e String }: String \x3d o match {\n  case None() \x3d\x3e "None()"\n  case Some(v) \x3d\x3e "Some(" ++ showA(v) ++ ")"\n}\ndef show(o: Option[Int]): String \x3d show(o) { e \x3d\x3e show(e) }\ndef show(o: Option[Double]): String \x3d show(o) { e \x3d\x3e show(e) }\ndef show(o: Option[Bool]): String \x3d show(o) { e \x3d\x3e show(e) }\n\ndef println(o: Option[Int]): Unit \x3d println(show(o))\ndef println(o: Option[Double]): Unit \x3d println(show(o))\ndef println(o: Option[Bool]): Unit \x3d println(show(o))\n');
Gv("common/bench.effekt",'module bench\n\n/**\n * The current time (since UNIX Epoch) in nanoseconds.\n *\n * The actual precision varies across the different backends.\n * - js: Milliseconds\n * - chez: Microseconds\n * - ml: Microseconds\n */\nextern io def timestamp(): Int \x3d\n  js "Date.now() * 1000000"\n  chez "(timestamp)"\n  ml "IntInf.toInt (Time.toNanoseconds (Time.now ()))"\n  llvm !!!MULTILINEMARKER!!!\n    %time_ptr \x3d alloca { i64, i64 }\n    call i32 @clock_gettime(i32 0, ptr %time_ptr)\n    %time \x3d load {i64, i64}, ptr %time_ptr\n    %time_seconds \x3d extractvalue {i64, i64} %time, 0\n    %time_nanoseconds \x3d extractvalue {i64, i64} %time, 1\n    %time_seconds_nanoseconds \x3d mul nsw i64 %time_seconds, 1000000000\n    %result \x3d add nsw i64 %time_seconds_nanoseconds, %time_nanoseconds\n    ret %Int %result\n  !!!MULTILINEMARKER!!!\n\nextern llvm !!!MULTILINEMARKER!!!\n  declare i32 @clock_gettime(i32, ptr)\n!!!MULTILINEMARKER!!!\n\n/**\n * High-precision timestamp in nanoseconds that should be for measurements.\n *\n * This timestamp should only be used for **relative** measurements,\n * as gives no guarantees on the absolute time (unlike a UNIX timestamp).\n */\nextern io def relativeTimestamp(): Int \x3d\n  js "Math.round(performance.now() * 1000000)"\n  default { timestamp() }\n\n/**\n * Runs the block and returns the time in nanoseconds\n */\ndef timed { block: \x3d\x3e Unit }: Int \x3d {\n  val before \x3d relativeTimestamp()\n  block()\n  val after \x3d relativeTimestamp()\n  after - before\n}\n\ndef measure(warmup: Int, iterations: Int) { block: \x3d\x3e Unit }: Unit \x3d {\n  def run(n: Int, report: Bool): Unit \x3d {\n    if (n \x3c\x3d 0) { () } else {\n      val time \x3d timed { block() };\n      if (report) { println(time) } else { () };\n      run(n - 1, report)\n    }\n  }\n  run(warmup, false)\n  run(iterations, true)\n}\n');
